import * as React from "react";
import { useRoutes } from "react-router-dom";
import Register from "../views/Register/Register";

function Router() {
  let element = useRoutes([
    {
        path: "/register",
      element: <Register />,
      children: [
        {   
          path: "messages",
          element: <DashboardMessages />,
        },
        {
        path: "messages",
        element: <DashboardMessages />,
      }
      ],
    }
  ]);
  return element;
}
export default Router;
